import React from 'react';

function IntroSection() {
  return (
    <section className="intro-section">
      <h2>О нашей компании</h2>
      <p>Мы создаем эксклюзивную мебель высшего качества уже более 20 лет...</p>
    </section>
  );
}

export default IntroSection;
